import 'bootstrap/dist/css/bootstrap.css';
import axios from "axios";
import Navbar from './navbar';
import { useState, useEffect } from 'react';
import { Link } from "react-router-dom";
import styled from "styled-components";
import Paper from '@mui/material/Paper';
import {
  Grid,
  DragDropProvider,
  Table,
  TableHeaderRow,
  TableColumnReordering,
} from '@devexpress/dx-react-grid-material-ui';

function GetExcel() {


    const [list, setList] = useState('');

    const [msg, setMsg] = useState('');

    const [status, setStatus] = useState('');
    const [postyear, setPY] = useState('');
    const [postmonth, setPM] = useState('');


    function clear(e) {
        setStatus('')
        setPY('')
        setPM('')
        dataLoad()
    }

    function filter(e) {
        e.preventDefault()

        axios.get('http://localhost:4000/getExcel?Status=' + status + "&PostingYear=" + postyear + "&PostingMonth=" + postmonth)
            .then(res => {
                console.log(res.data)
                let arr = res.data.data
                if (arr.length != 0) {
                    setList(arr)
                    setMsg('')
                } else {
                    setMsg("No Data Available To Show")
                    setList('')
                }

            })
    }

    let dataLoad = async () => {
        await axios.get('http://localhost:4000/getExcel')
            .then(res => {
                console.log(res.data)
                let arr = res.data.data
                if (arr.length != 0) {
                    setList(arr)
                    setMsg('')
                }
                else {
                    setMsg("No Data Available To Show")
                    setList('')
                }
            })
            .catch(error => {
                console.log(error.message)
            })
    }

    useEffect(dataLoad
        , [])

    let array = [...list]
    let column = [
        "CompanyName",
        "BusinessUnitName",
        "ReportingLevel4",
        "Quantity",
        "AmountEUR",
        "PostingYear",
        "PostingMonth",
        "ActionType",
        "ActionNumber",
        "ActionName",
        "Status"

    ]



    const [columns] = useState(column);
      const [roww] = useState(array);
      const [tableColumnExtensions] = useState([
        { columnName: 'CompanyName', width: 100 },
      ]);



    // const [cols, setCols] = useState(column);
    // const [rows, setRows] = useState(array);
    // const [dragOver, setDragOver] = useState("");


    // const handleDragStart = e => {
    //     const { id } = e.target;
    //     const idx = cols.indexOf(id);
    //     e.dataTransfer.setData("colIdx", idx);
    // };

    // const handleDragOver = e => e.preventDefault();
    // const handleDragEnter = e => {
    //     const { id } = e.target;
    //     setDragOver(id);
    // };

    // const handleOnDrop = e => {
    //     const { id } = e.target;
    //     const droppedColIdx = cols.indexOf(id);
    //     const draggedColIdx = e.dataTransfer.getData("colIdx");
    //     const tempCols = [...cols];

    //     tempCols[draggedColIdx] = cols[droppedColIdx];
    //     tempCols[droppedColIdx] = cols[draggedColIdx];
    //     setCols(tempCols);
    //     setDragOver("");
    // };


    return (
        <div>
            {<Navbar />}
            <h3 class="text-center mt-3 ">Data List</h3>

            <form class="form-inline row m-4" onSubmit={filter}>
                <div class="col-sm-3">
                    <select class="form-select" name="status" onChange={e => setStatus(e.target.value)} value={status}>
                        <option selected>Status</option>
                        <option value="In-Progress">In-Progress</option>
                        <option value="Pending">Pending</option>
                        <option value="Completed">Completed</option>
                    </select>
                </div>

                <div class="col-sm-3">
                    <select class="form-select" name="postyear" onChange={e => setPY(e.target.value)} value={postyear}>
                        <option selected>Posting Year</option>
                        <option value="2020">2020</option>
                        <option value="2021">2021</option>
                        <option value="2022">2022</option>
                    </select>
                </div>

                <div class="col-sm-3">
                    <select class="form-select" name="postmonth" onChange={e => setPM(e.target.value)} value={postmonth}>
                        <option selected>Posting Month</option>
                        <option value="1">1</option>
                        <option value="2">2</option>
                        <option value="3">3</option>
                        <option value="4">4</option>
                        <option value="5">5</option>
                        <option value="6">6</option>
                        <option value="7">7</option>
                        <option value="8">8</option>
                        <option value="9">9</option>
                        <option value="10">10</option>
                        <option value="11">11</option>
                        <option value="12">12</option>
                    </select>
                </div>

                <div class="col-sm-3">
                    <button type="submit" class="btn btn-primary">Filter</button>
                    <button type='button' class="btn btn-danger ms-2" onClick={clear}>Clear</button>
                </div>
            </form>

            {/* <table class="table mt-2 table-striped">
                <thead class="bg-info text-light">
                    <tr>
                        {cols.map(col => (
                            <StyledTh
                                id={col}
                                key={col}
                                draggable
                                onDragStart={handleDragStart}
                                onDragOver={handleDragOver}
                                onDrop={handleOnDrop}
                                onDragEnter={handleDragEnter}
                                dragOver={col === dragOver}
                            >
                                {col}
                            </StyledTh>
                        ))} */}
                        {/* <th scope="col">CompanyName</th>
                        <th scope="col">BusinessUnitName</th>
                        <th scope="col">ReportingLevel4</th>
                        <th scope="col">Quantity</th>
                        <th scope="col">AmountEUR</th>
                        <th scope="col">PostingYear</th>
                        <th scope="col">PostingMonth</th>
                        <th scope="col">ActionType</th>
                        <th scope="col">ActionNumber</th>
                        <th scope="col">ActionName</th>
                        <th scope="col">Status</th>
                        <th scope="col">Edit</th> */}
                    {/* </tr>
                </thead>
                <tbody>
                    {rows.map(row => (
                        <tr key={row.id}>
                            {Object.entries(row).map(([k, v], idx) => 
                            (
                                <Cell key={v} dragOver={cols[idx] === dragOver}>
                                    {row[cols[idx]]}
                                </Cell>
                            ))}
                        </tr>
                    ))} */}
                    {/* {array.map((i) => {

                        return (
                            <tr>
                                <td>{i.CompanyName}</td>
                                <td>{i.BusinessUnitName}</td>
                                <td>{i.ReportingLevel4}</td>
                                <td>{i.Quantity}</td>
                                <td>{i.AmountEUR}</td>
                                <td>{i.PostingYear}</td>
                                <td>{i.PostingMonth}</td>
                                <td>{i.ActionType}</td>
                                <td>{i.ActionNumber}</td>
                                <td>{i.ActionName}</td>
                                <td>{i.Status}</td>
                                <td>
                                    <Link to={"/editExcel/" + i["_id"]}>Edit</Link>
                                </td>
                            </tr>
                        );
                    })} */}
                {/* </tbody>
            </table> */}


            <Paper>
      <Grid
        rows={roww}
        columns={columns}
      >
        <DragDropProvider />
        <Table
          columnExtensions={tableColumnExtensions}
        />
        <TableColumnReordering
          defaultOrder={[
            "CompanyName",
            "BusinessUnitName",
            "ReportingLevel4",
            "Quantity",
            "AmountEUR",
            "PostingYear",
            "PostingMonth",
            "ActionType",
            "ActionNumber",
            "ActionName",
            "Status"
    
        ]}
        />
        <TableHeaderRow />
      </Grid>
    </Paper>



            <p class="font-monospace text-center fs-4 mt-5">{msg}</p>
        </div>
    );
}

// const Table = styled.table`
