//   text-align: left;
//   text-transform: capitalize;
//   vertical-align: center;
//   padding: 20px;
//   border-bottom: 2px solid #eef0f5;
//   text-transform: lowercase;
//   border-left: ${({ dragOver }) => dragOver && "5px solid red"};
// `;

